import React, { useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import fondlogin from './img/loginfond.jpg'

function Login() {
    return (
        <div style={{margin: 0, padding: 0}}>
            <img src={fondlogin} style={{ width: window.innerWidth, height: window.innerHeight, margin: 0, padding: 0, position: 'absolute'}}/>
            <h2 style={{position: 'absolute', top: window.innerHeight / 4, left: (window.innerWidth / 2) - 20}}>
              GEZ
            </h2>
        </div>
    )
}

export default function App() {
    return (
        <Router>
          <div style={{margin: 0, padding: 0}}>
            <Login/>
          </div>
        </Router>
    )
  }
